import { configureStore } from '@reduxjs/toolkit';

import navBarReducer from '../features/navBarList/navBarSlice'
import linkItemAddSlice from '../features/linkItemAdd/linkItemAddSlice'
import navBarAddSlice from '../features/navBarAdd/navBarAddSlice'
import linkItemListSlice from '../features/navBarList/navBarSlice'

export const store = configureStore({
  reducer: {
    navBar:navBarReducer,
    linkItemAdd:linkItemAddSlice,
    navBarAdd:navBarAddSlice,
    linkItemList:linkItemListSlice
  },
});
